import{_ as e,o,c as t,O as n}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 3.2-2800 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-2800.md","filePath":"vacode/3.2-2800.md"}'),a={name:"vacode/3.2-2800.md"},s=n('<h1 id="§-3-2-2800-definitions" tabindex="-1">§ 3.2-2800 Definitions. <a class="header-anchor" href="#§-3-2-2800-definitions" aria-label="Permalink to &quot;§ 3.2-2800 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Beekeeper&quot; means any person who keeps and manages bees for profit, and shall include those growers who keep bees for pollinating crops.</p><p>&quot;Cross pollination&quot; means the transfer of pollen from the anthers of blossoms to the stigmas of other blossoms of the same crops or a variety of the same crop.</p><p>&quot;Pollination contractor&quot; means any person who contracts to supply a means of cross pollinating the blossoms of any specified plant.</p><p>&quot;Producer&quot; means any person engaged in the business of raising crops that benefit from cross pollination by honeybees or other pollinating insects.</p><p>1977, c. 452, § 3.1-610.23; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>; 2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0594" target="_blank" rel="noreferrer">594</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0681" target="_blank" rel="noreferrer">681</a>.</p>',7),r=[s];function i(l,p,c,f,h,_){return o(),t("div",null,r)}const m=e(a,[["render",i]]);export{g as __pageData,m as default};
